    public static <E> boolean isListEqual(Collection<E> listA, Collection<E> listB) {
        Collection<E> list1 = Optional.ofNullable(listA).orElse(new ArrayList<>());
        Collection<E> list2 = Optional.ofNullable(listB).orElse(new ArrayList<>());
        // 两个list引用相同（包括两者都为空指针的情况）
        if (list1 == list2) {
            return true;
        }

        // 两个list元素个数不相同
        if (list1.size() != list2.size()) {
            return false;
        }

        // 两个list元素个数已经相同，再比较两者内容
        // 采用这种可以忽略list中的元素的顺序
        // 涉及到对象的比较是否相同时，确保实现了equals()方法
        return list1.containsAll(list2);
    }
